import React from "react";
import {　BrowserRouter as Router,　Switch,　Route　} from "react-router-dom";
import Home from "./components/Home";
import Congrats from "./components/Congrats";
import Again from "./components/Again";
import './App.scss';

function App() {
  return (
    <>
    <Router>
      <div>
        <Switch>
          <Route path="/congrats">
            <Congrats />
          </Route>
          <Route path="/again">
            <Again />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
    </>
  );
}

export default App;
